import './App.scss';
import Brainflix from './components/Brainflix/Brainflix';
import { BrowserRouter, Route, Switch} from 'react-router-dom'

function App() {
  return (
    <div className="App">
		<BrowserRouter>
			<Route path='/' Component={Brainflix} />
		</BrowserRouter>
    </div>
  );
}

export default App;
